import React from 'react';
import { useAuth } from '../context/AuthContext';
import { Container, Typography, Paper, Box } from '@mui/material';

const Account = () => {
  const { user } = useAuth();

  if (!user) {
    return (
      <Container maxWidth="sm" sx={{ py: 6 }}>
        <Paper sx={{ p: 4, textAlign: 'center' }}>
          <Typography variant="h6">You are not logged in.</Typography>
        </Paper>
      </Container>
    );
  }

  return (
    <Container maxWidth="sm" sx={{ py: 6 }}>
      <Paper sx={{ p: 4 }}>
        <Typography variant="h5" gutterBottom>Account Details</Typography>
        <Box sx={{ mb: 2 }}>
          <Typography><b>Name:</b> {user.name}</Typography>
          <Typography><b>Email:</b> {user.email}</Typography>
          <Typography><b>Phone:</b> {user.phone}</Typography>
          {user.city && <Typography><b>City:</b> {user.city}</Typography>}
          {user.role && <Typography><b>Role:</b> {user.role}</Typography>}
          {user.createdAt && <Typography><b>Joined:</b> {new Date(user.createdAt).toLocaleDateString()}</Typography>}
        </Box>
      </Paper>
    </Container>
  );
};

export default Account;
